import React, { useState } from 'react';
//import './monitor.css'
import DropdownSelector from './drop-box-login'; 

import ReactDOM from 'react-dom/client';
import reportWebVitals from './reportWebVitals';

function HomePage(){ 
    const selectedPatient = JSON.parse(localStorage.getItem('selectedPatient'));
    return (
<div className="MonitoringScreen" style={{width: 1440, height: 1024, position: 'relative', background: 'white'}}>
  <div className="NavBar" style={{width: 1440, height: 120, left: 0, top: 0, position: 'absolute', background: '#D9D9D9'}} />
  <img className="ProfileIcon" style={{width: 70, height: 70, left: 51, top: 25, position: 'absolute'}} src="https://via.placeholder.com/70x70" />
  <div className="SaraNorman" style={{left: 151, top: 20, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 32, fontFamily: 'Outfit', fontWeight: '500', wordWrap: 'break-word'}}>Sara Norman</div>
  <div className="Id53449709" style={{left: 151, top: 60, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 24, fontFamily: 'Outfit', fontWeight: '500', wordWrap: 'break-word'}}>ID: 5344-9709</div>
  <div className="LogOutBtn" style={{width: 133, height: 51, left: 1182, top: 35, position: 'absolute'}}>
    <div className="Rectangle5" style={{width: 133, height: 51, left: 0, top: 0, position: 'absolute', background: 'black', borderRadius: 24}} />
    <div className="LogOut" style={{left: 27, top: 10, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 24, fontFamily: 'Outfit', fontWeight: '500', wordWrap: 'break-word'}}>Log out</div>
  </div>
  <div className="LoginBox" style={{width: 1096, height: 668, left: 172, top: 231, position: 'absolute', background: '#D9D9D9', borderRadius: 94}} />
  <div className="BloodGlucoseMonitoring" style={{left: 447, top: 289, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 48, fontFamily: 'Outfit', fontWeight: '500', wordWrap: 'break-word'}}>Blood Glucose Monitoring </div>
  <div className="PleaseAnswerTheFollowingQuestionS" style={{left: 443, top: 381, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 32, fontFamily: 'Outfit', fontWeight: '500', wordWrap: 'break-word'}}>Please answer the following question(s)</div>
  <div className="Questions" style={{width: 871, height: 306, left: 284, top: 470, position: 'absolute'}}>
    <div className="QuestionBox" style={{width: 871, height: 306, left: 0, top: 0, position: 'absolute', background: 'white'}} />
    <div className="HaveYouTakenYourBloodSugarReadingToday" style={{left: 93, top: 42, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 32, fontFamily: 'Outfit', fontWeight: '500', wordWrap: 'break-word'}}>Have you taken your blood sugar reading today? </div>
    <div className="NoBtn" style={{width: 143, height: 56, left: 492, top: 148, position: 'absolute'}}>
      <div className="Rectangle8" style={{width: 143, height: 56, left: 0, top: 0, position: 'absolute', background: '#FD5151', borderRadius: 33}} />
      <div className="No" style={{left: 56, top: 13, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 24, fontFamily: 'Outfit', fontWeight: '500', wordWrap: 'break-word'}}>No</div>
    </div>
    <div className="YesBtn" style={{width: 143, height: 56, left: 263, top: 148, position: 'absolute'}}>
      <div className="Rectangle7" style={{width: 143, height: 56, left: 0, top: 0, position: 'absolute', background: '#32DE43', borderRadius: 33}} />
      <div className="Yes" style={{left: 54, top: 13, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 24, fontFamily: 'Outfit', fontWeight: '500', wordWrap: 'break-word'}}>Yes</div>
    </div>
  </div>
</div>

    );
}
export default HomePage;
